	return (
		<div className="login-page-wrapper">
			<div className="login-content-wrapper">
				<div className="login-image-wrapper">
					<img src="/images/user/login-register.png" alt="user login" />
				</div>
                <div className="login-form-wrapper">
                    <h3>L</h3>
                </div>
			</div>
		</div>
	);
}
